import React from 'react';

import './item-list.css';

const ItemList = () => {
    return (
        <nav className="header d-flex justify-content-between">
            <nav>
                <a href="#">Luke Skywalker</a>
                <a href="#">Darth Vader</a>
                <a href="#">R2-D2</a>
            </nav>

            <table className="table">
                <tr className="d-flex">
                    <th>Luke Skywalker</th>
                </tr>
                <tr className="d-flex">
                    <th>Darth Vader</th>
                </tr>
                <tr className="d-flex">
                    <th>R2-D2</th>
                </tr>
            </table>
        </nav>
    )
};

export default ItemList;
